(2595, '‎The Stack Overflow Podcast on Apple Podcasts', 'https://podcasts.apple.com/us/podcast/the-stack-overflow-podcast/id1033688462', '‎The Stack Overflow podcast is a weekly conversation about working in software development, learning to code, and the art and culture of computer programming. Hosted by Paul Ford and Ben Popper, the series features questions from our community, interviews with fascinating guests, and hot takes on wha…', 'The Stack Overflow Podcast, The Stack Overflow Podcast, podcast show, listen, download, apple podcasts'),
(2596, 'The Stack Overflow Podcast', 'https://www.google.com/podcasts?feed=aHR0cHM6Ly9mZWVkcy5zaW1wbGVjYXN0LmNvbS9YQV84NTFrMw%3D%3D', 'The Stack Overflow podcast is a weekly conversation about working in software development, learning to code, and the art and culture of computer programming. Hosted by Paul Ford and Ben Popper, the series features questions from our community, interviews with fascinating guests, and hot takes on what’s happening in tech. Founded in 2008, Stack Overflow is empowering the world to develop technology through collective knowledge. It’s best known for being the largest, most trusted online community for developers and technologists. More than 100 million people come to Stack Overflow every month to ask questions, help solve coding problems, and develop new skills.', ''),
(2597, 'Stream The Stack Overflow Podcast music | Listen to songs, albums, playlists for free on SoundCloud', 'https://soundcloud.com/stack-exchange', 'Play The Stack Overflow Podcast and discover followers on SoundCloud | Stream tracks, albums, playlists on desktop and mobile.', 'record, sounds, share, sound, audio, tracks, music, soundcloud'),
(2598, 'The Stack Overflow Podcast - Page 2 of 34', 'https://stackoverflow.blog/podcast/page/2/', 'The Stack Overflow podcast is a frank and funny conversation about what it means to work in software and how code is reshaping our world. As it celebrates its 12th anniversary, it’s a must listen for any programmer, as necessary as Stack Overflow itself.\"', ''),
(2599, 'The Stack Overflow Podcast - Page 3 of 34', 'https://stackoverflow.blog/podcast/page/3/', 'The Stack Overflow podcast is a frank and funny conversation about what it means to work in software and how code is reshaping our world. As it celebrates its 12th anniversary, it’s a must listen for any programmer, as necessary as Stack Overflow itself.\"', ''),
