(2603, 'Brad Burnham | Union Square Ventures', 'https://www.usv.com/people/brad-burnham/', 'Brad Burnham is a partner at Union Square Ventures. He started working in information technology with AT&T in 1979. Brad spun Echo Logic out of Bell Laboratories in 1989 and joined AT&T Ventures in 1993. Brad co-founded TACODA in 2001 before joining Fred to create Union Square Ventures in 2003. Brad majored in political science at Wesleyan University. He is married with two kids and lives in New York City.', ''),
(2604, 'Glitch', 'https://glitch.com/@anildash', 'Simple, powerful, free tools to create and use millions of apps.', ''),
(2605, 'Stack Overflow senior leadership team & board of directors', 'https://stackoverflow.com/company/leadership#', 'Founded in 2008, Stack Overflow’s public platform is used by nearly everyone who codes to learn, share their knowledge, collaborate, and build their careers.', ''),
(2606, 'Develop your future at Stack Overflow', 'https://stackoverflow.com/company/careers#', 'Join a fast-growing tech company that empowers people to deliver outstanding results and to learn and grow along the way.', ''),
