(2680, 'Index Ventures | Disclaimer | Index Ventures', 'https://indexventures.com/disclaimer/', 'Index Ventures intellectual propertyThe content on this site – including trademarks, logos, photos, descriptions and other original material – should not be reproduced without our prior written consent. “Index Ventures” is one of our registered trademarks. Other trademarks, such as those of our portfolio companies, are owned by their respective owners.Third party sitesThis site may from time to time include links to other websites as a convenience. We do not make any express or implied warranties with regard to the information, material, products or services that are contained on or accessible through linked websites and have no responsibility for or liability arising out of or related to such websites or their contents.No offer and no adviceThis site is for general information purposes only and is subject to change without notice. Nothing on this site should be construed as an offer, invitation or general solicitation to buy or sell any investment or securities, provide investment advisory services, make personal recommendations or to engage in any other transaction, and must not be relied upon in connection with any investment decision. Information on this site is not intended to and does not constitute financial, accounting, tax, legal, investment, consulting or other professional advice or services.Privacy statementIndex Ventures take the issue of privacy seriously. We recognise that, when you provide us with information about yourself or your business, you are trusting us to act in a responsible manner and we are committed to making sure that we earn that trust.Our policy for how we use information that you provide us, or that we collect through your use of our site, is set out below. Please note that by visiting our site, you are accepting the practices described in this notice.The information we collectWhen you visit indexventures.com, we collect information that helps us understand how people use our website so that we can continue to make it more useful and valuable over time. No information we collect in this way is directly or indirectly traceable back to a specific person. In addition to gathering basic usage information, we also collect information that helps us monitor network traffic and enables us to identify unauthorised or unusual activity on the site. The specific information we collect includes:Name of the domain and host from which you access the internet, internet protocol address of the host server you are using, names and version of your web browser, the date and time you access our site, and the internet address of the site from which you linked to us, where applicable.CookiesSome parts of the site may use a ‘cookie’, which is a small text file that is placed on your computer’s hard drive. The cookie captures no personally identifiable information. The site may use a cookie in order to log which pages you visit or to provide enhanced capabilities during your visit. You can set your browser to refuse to accept cookies; however if you choose to do this, some features of this site and others may not function properly.Personal InformationUnless you submit a business plan to us, or register for our Talent Roster, we do not collect your name or email address.We will not sell, distribute or lease your personal information to third parties unless we have your permission or are required by law to do so. You may request details of personal information we hold about you under the Data Protection Act 2018. A small fee will be payable. If you would like a copy of the information held on you please contact any of our offices.', ''),
(2681, 'Index Ventures | Privacy Policy | Index Ventures', 'https://indexventures.com/privacy-policy/', 'This Privacy Policy explains how we use the personal information that Index Ventures collects or generates both in relation to this website and our products and services.1. Background1.1 — Index Ventures (UK) LLP with its registered office at 3 Burlington Gardens, London W1S 3EP and other companies in the Index Ventures group collect and use certain Personal Data. Index Ventures is responsible for ensuring that it uses that Personal Data in compliance with data protection laws.1.2 — At Index Ventures we respect the privacy of our clients and we are committed to keeping all your Personal Data secure. This Privacy Policy governs the handling of Personal Data by Index Ventures in the course of carrying on commercial activities.1.3 — We use the following definitions in this Privacy Policy: “Index Ventures”, “we” or “us” means Index Ventures (UK) LLP and other companies in the Index Ventures group.“Personal Data” means any data which relates to a living individual who can be identified from that data or from that data and other information which is in the possession of, or is likely to come into the possession of, Index Ventures (or its representatives or service providers). In addition to factual information, it includes any expression of opinion about an individual and any indication of the intentions of Index Ventures or any other person in respect of an individual.2. The products and services we provide2.1 — This Privacy Policy concerns the following categories of information that we collect about you when providing the following products and services:Information we receive through our websites (\"Index Ventures Websites\"); andInformation we receive through or in connection with the provision of our products and services (\"Services\").3. The types of personal data we collect3.1 — Many of the services offered by Index Ventures require us to obtain Personal Data about you in order to perform the services we have been engaged to provide. In relation to each of the services described at paragraph 2.1 above, we will collect and process the following Personal Data about you:Information that you provide to Index Ventures. This includes information about you that you provide to us. The nature of the services you are requesting will determine the kind of Personal Data we might ask for, though such information may include (by way of a non-exhaustive list):Basic Personal Data (such as first name; family name; position in the company; company name; company email address; business phone number; business address; city; postcode; country);Any information that you choose to share with us (whether through our websites or otherwise) which may be considered Personal Data;Information that we collect or generate about you. This includes (by way of a non-exhaustive list):Information about the Services which you have purchased and our interactions with you;When you visit Index Ventures Websites, cookies are used to collect technical information about the services that you use, and how you use them.  For more information on the cookies used by Index Ventures please see our Cookie Notice.Information we obtain from other sources.We may be supplied with CV of prospective candidates for roles at both Index Ventures and our portfolio companies.We may from time to time use 3rd party public and private data sources to find out more information about an individual’s employment historyAnonymized dataIn addition to the categories of Personal Data described above, Index Ventures will also process further anonymized information and data that is not processed by reference to a specific individual.4. How we use your information4.1 — Your Personal Data may be stored and processed by us in the following ways and for the following purposes:For ongoing review and improvement of the information provided on or operation and security of Index Ventures Websites;To assess your application for our Services, where applicable;To set you up as a customer;To provide you with our ServicesTo understand feedback on our Services and to help provide more information on the use of those products and services quickly and easily;To communicate with you in order to provide you with services or information about Index Ventures and our products and services;To understand your needs and interests;For the management and administration of our business;In order to comply with and in order to assess compliance with applicable laws, rules and regulations, and internal policies and procedures;For the administration and maintenance of databases storing Personal Data; and / orWe may process business communications traffic data sent and received by us for the purposes of evaluating our existing or prospective business relationship.4.2 — However we use Personal Data we make sure that the usage complies with law and the law allows us and requires us to use Personal Data for a variety of reasons. These include where:We need to do so in order to perform our contractual obligations with our customers;We have obtained your consent;We have legal and regulatory obligations that we have to discharge;We may need to do so in order to establish, exercise or defend our legal rights or for the purpose of legal proceedings;The use of your Personal Data as described is necessary for our legitimate business interests, such as:Allowing us to effectively and efficiently manage and administer the operation of our business;Conducting market research or business analysis;Maintaining compliance with internal policies and procedures; andPromoting our business or Index Ventures Services.4.3 — We will take steps to ensure that the Personal Data is accessed only by employees of Index Ventures that have a need to do so for the purposes described in this Privacy Policy.5. Disclosure of your information to third parties5.1 — We may share your Personal Data within the Index Ventures group of companies for the purposes described above5.2 — We may also share your Personal Data outside of the Index Ventures group for the following purposes:With our business partners. For example, this could include intermediaries that introduced you to us or through whom you purchased our Services. Personal Data will only be transferred to a business partner who is contractually obliged to comply with appropriate data protection obligations and the relevant privacy and confidentiality legislation;With third party agents and contractors for the purposes of providing services to us (for example, Index Ventures’ accountants, professional advisors, IT and communications providers and debt collectors). These third parties will be subject to appropriate data protection obligations and they will only use your Personal Data as described in this Privacy Policy;To the extent required by law, for example if we are under a duty to disclose your Personal Data in order to comply with any legal obligation (including, without limitation, in order to comply with tax reporting requirements and disclosures to regulators), or to establish, exercise or defend our legal rights;If we sell our business or assets, in which case we may need to disclose your Personal Data to the prospective buyer for due diligence purposes; andIf we are acquired by a third party, in which case the Personal Data held by us about you will be disclosed to the third party buyer.6. International transfers of personal data6.1 — Index Ventures is a global business. Our operations are spread around the world. As a result, we collect and transfer Personal Data on a global basis. That means that we may transfer your Personal Data to locations outside of your country.6.2 — Where we transfer your Personal Data to another country outside the EEA, we will ensure that it is protected and transferred in a manner consistent with legal requirements. In relation to data being transferred outside of Europe, for example, this may be done in one of the following ways:The country that we send the data to might be approved by the European Commission as offering an adequate level of protection for Personal Data;The recipient might have signed up to a contract based on “model contractual clauses” approved by the European Commission, obliging them to protect your Personal Data;Where the recipient is located in the US, it might be a certified member of the EU-US Privacy Shield scheme; orIn other circumstances the law may permit us to otherwise transfer your Personal Data outside Europe.6.3 — You can obtain more details of the protection given to your Personal Data when it is transferred outside Europe (including a copy of the standard data protection clauses which we have entered into with recipients of your Personal Data) by contacting us as described in paragraph 11 below.7. How we safeguard your information7.1 — We have extensive controls in place to maintain the security of our information and information systems. The information that we handle is protected with safeguards appropriate to the sensitivity of the relevant information. Appropriate controls (such as restricted access) are placed on our computer systems. Physical access to areas where Personal Data is gathered, processed or stored is limited to authorised employees.7.2 — As a condition of employment, Index Ventures employees are required to follow all applicable laws and regulations, including in relation to data protection law. Access to sensitive Personal Data is limited to those employees who need to it to perform their roles. Unauthorised use or disclosure of confidential client information by an Index Ventures employee is prohibited and may result in disciplinary measures.8. How long we keep your personal data8.1 — How long we will hold your Personal Data for will vary and will be determined by the following criteria:The purpose for which we are using it – Index Ventures will need to keep the data for as long as is necessary for that purpose; andLegal obligations – laws or regulation may set a minimum period for which we have to keep your Personal Data.9. Your rights9.1 — In all the above cases in which we collect, use or store your Personal Data, you may have the following rights and, in most cases, you can exercise them free of charge. These rights include:The right to obtain information regarding the processing of your Personal Data and access to the Personal Data which we hold about you;The right to withdraw your consent to the processing of your Personal Data at any time. Please note, however, that we may still be entitled to process your Personal Data if we have another legitimate reason for doing so. For example, we may need to retain Personal Data to comply with a legal obligation;In some circumstances, the right to receive some Personal Data in a structured, commonly used and machine-readable format and/or request that we transmit those data to a third party where this is technically feasible. Please note that this right only applies to Personal Data which you have provided directly to Index Ventures;The right to request that we rectify your Personal Data if it is inaccurate or incomplete;The right to request that we erase your Personal Data in certain circumstances. Please note that there may be circumstances where you ask us to erase your Personal Data but we are legally entitled to retain it;The right to object to, or request that we restrict, our processing of your Personal Data in certain circumstances. Again, there may be circumstances where you object to, or ask us to restrict, our processing of your Personal Data but we are legally entitled to refuse that request; andThe right to lodge a complaint with the relevant data protection regulator if you think that any of your rights have been infringed by us.9.2 — You can exercise your rights by contacting us using the details listed in paragraph 11 below.10. Designated representative10.1 — Index Ventures (UK) LLP’s registered office may be contacted using the following contact information:Index Ventures (UK) LLP, Burlington Gardens, London W1S 3EPdataprotection@indexventures.com11. Questions and concerns11.1 — If you have any questions or concerns about Index Ventures’ handling of your Personal Data, or about this Policy, please contact the Data Protection Team using the following contact information:Index Ventures (UK) LLP, Burlington Gardens, London W1S 3EPdataprotection@indexventures.comWe are usually able to resolve privacy questions or concerns promptly and effectively. If you are not satisfied with the response you receive, you may escalate concerns to the applicable privacy regulator in your jurisdiction. Upon request, we will provide you with the contact information for that regulator.', ''),
