(2684, 'Roblox: The Long March to the Metaverse | by Neil Rimer | Index Ventures', 'https://indexventures.com/perspectives/roblox-the-long-march-to-the-metaverse/', 'A new type of media company is about to go public. It taps into the zeitgeist and creates products that entertain, inform and inspire people around the globe through the power of unparalleled storytelling. It promises to ride technological trends that will make its content increasingly realistic and engaging for a growing global audience. It has also created an immersive new environment where its audience can interact with characters and storylines in thrilling new ways, purchase unique items and enjoy the experience with friends and family. What’s more, this company has found a new source of content that’s inexhaustible, evergreen, and universally appealing, and can be developed and produced more efficiently than that of its rivals. Roblox? Think again. The year is 1957, Elvis Presley is dominating the radio waves, Martin Luther King just spoke at the March on Washington – and the company is Walt Disney Productions.In many ways, Roblox which will go public today via direct listing on the NYSE could be considered a 21st-century Disney: a category-defining media company that capitalized on major demographic and technological changes to create totally new forms of entertainment and human interaction. Setting the two side-by-side reveals some interesting parallels. At the time of its IPO, Disney was valued at $32.5 million – approximately $306 million in today’s money. Its eighteenth full-length animated feature (Sleeping Beauty) was in production, and it had just opened Disneyland, an amusement park near Los Angeles. Fast forward half a century: last week, The Walt Disney Company earned five Golden Globes for Pixar’s Soul, Searchlight’s Nomadland, and Hulu’s The United States vs. Billie Holiday. As well as its family of theme parks, it controls several franchises including Pixar, Lucasfilm, Hulu, ESPN and Disney+, and is valued at $358 billion.In many ways, Roblox which will go public today via direct listing on the NYSE, could be considered a 21st-century Disney: a category-defining media company that capitalized on major demographic and technological changes to create totally new forms of entertainment and human interaction.When Dave Baszucki and Eric Cassel started Roblox in 2004, they envisioned a virtual world where people of all ages, from all over the globe, could engage in a variety of collective experiences limited only by their imagination. The pair set off to build a world that could be explored by hundreds of millions of people simultaneously, in their own language, using their preferred device. A teenager on a subway in Seoul could play and chat with other girls in Seattle in a game created by a brilliant 15-year-old developer in Buenos Aires. That bold vision on the verge of science-fiction – a metaverse of rich, user-generated content and real-time co-experience – has not changed to this day. What has changed is that it’s now a reality, the phenomenon that is Roblox: 32.6 million daily users, 8 million creators, billions of hours of engagement every month, and more than 20 million experiences – from running a pizza parlor to escaping a labyrinth, to learning how to scuba dive.I met Dave when we were students together at Stanford in the mid-80s. We were both fans of the movie Mad Max and used to talk about building radically modified vehicles inspired by the movie, racing them, and crashing them. Dave thought that it would be cool to allow kids to build things on a Macintosh and then let the laws of physics act on them as they were dropped from great heights or collided into each other in a realistic simulation. That was the birth of his first product Interactive Physics and the germ of the idea of Roblox.', ''),
(2685, 'Discord: the Community Home with Soul | by Danny Rimer | Index Ventures', 'https://indexventures.com/perspectives/discord-community-home-soul/', 'It’s increasingly difficult for an online business to do something new today, but that’s what Discord has managed to accomplish. They have built a communications platform with a soul, and with a social and community-centric purpose at its core. It gives people a new home to talk, have genuine conversations, and build long-lasting relationships around shared interests and passions.I first met Jason Citron, Discord’s co-founder and CEO, in 2017. It was supposed to be a quick coffee, but he wanted a detailed breakdown of why an e-commerce startup investment I backed had been struggling. That wasn’t really how I’d hoped to impress a founder! But we hit it off, and at dinner with a few of my partners the next night Jason shared Discord’s user engagement metrics. We were all blown away — I’d never seen numbers like that and still haven’t. We moved in record time to get term sheets sorted. Jason, along with CTO and co-founder Stan Vishnevskiy, have both proved to be unusually scalable entrepreneurs who are growing in ambition and capability with the business. The fact that they are both so down to earth makes the relationship even more rewarding.The team never compromised on quality while they were building the site. Discord was something they were building for themselves and for the user community they felt so close to. It’s still an unusually engaged audience; the critical metric here is how many of their 100 million monthly active users use it daily. Only the biggest social media sites can claim a ratio of 50%, but Discord has a truly extraordinary level of engagement.', ''),
(2686, 'Confluent’s Graduation Day | by Mike Volpi | Index Ventures', 'https://indexventures.com/perspectives/confluents-graduation-day/', 'The somewhat dilapidated business suite next to a dentist’s office that was home to Confluent back in 2015 wasn’t that discouraging to me. We were pretty convinced from day one that we wanted to invest in the company. We had discovered the popularity of Apache Kafka through a CTO survey we regularly conduct at Index. It was clear that Kafka was being used everywhere, from companies in the tech sector to the Fortune 500 and governmental agencies. Anyone that was dealing with data-in-motion was deploying Kafka to do the job. Having seen the journey of Elastic from a popular open-source project to a commercial entity generating hundreds of millions of revenue, we knew we could replicate the success with Kafka.', ''),
