(2837, 'GitHub Integration Demo', 'https://stackoverflowsolutions.com/teams/github-integration-demo', 'To build great products, you need great discovery. Sometimes that means looking at old code or projects that never made it out the door to learn and evolve. Being able to find answers to questions on specific PRs, Gists and Commits, you’ll spend less time digging and more time building. See how our GitHub Enterprise integration works in this quick demo.', ''),
(2838, 'How to create a Collection', 'https://stackoverflowsolutions.com/teams/grouping-questions-answers-and-articles-together', 'Grouping questions, answers, and Articles together into a Collection is one of the key benefits of our Business and Enterprise plans. Find out how to create a Collection and add content to make accessing information easier than ever.', ''),
(2839, 'How to write an Article', 'https://stackoverflowsolutions.com/teams/how-to-write-an-article', 'With our Business and Enterprise plans your Team has access to Articles - a way to store longer-form content like project docs, how-to-guides, and so much more. Watch the quick video below to see how Articles works.', ''),
(2840, 'Our latest Slack integration', 'https://stackoverflowsolutions.com/teams/slack-v3-demo', 'Make your team even more efficient by helping them find and share knowledge without leaving Slack. See how the new Ask on Stack Overflow for Teams experience in Slack works in this quick 90-second video.', ''),
(2841, 'Low-Context DevOps: A new way of improving DevOps/SRE team culture', 'https://stackoverflowsolutions.com/teams/improve-devops-culture', 'In this article I begin with an explanation of the sociology concepts, then focus on five ways to lower context, or leverage low-context techniques.\n\nKeeping these techniques in mind, we can create SRE environments that are less frustrating and more productive.\n\nI’ll offer a few suggestions along the way, including Stack Overflow for Teams, which is like stackoverflow.com but it gives a private, secure, place for an organization to maintain their own corpus of questions and answers. I find that many engineers who strongly dislike writing documentation will gladly answer questions from a coworker.', ''),
