(2843, 'Centarro Discusses How Stack Overflow for Teams Makes Customer Support More Effective', 'https://stackoverflowsolutions.com/teams/centarro-uses-stack-overflow-for-teams-for-effective-customer-support', 'We sat down with Ryan Szrama, President/CEO at Centarro, to learn more about how they use Stack Overflow for Teams for their customer support.', ''),
(2844, 'Unqork leverages Stack Overflow for Teams to solve customer problems', 'https://stackoverflowsolutions.com/teams/unqork-successful-sme-program', 'See how Unqork leverages Stack Overflow for Teams to solve customer problems and share information without distractions. They’ll even walk through how they engage people to share information through a highly successful Subject Matter Expert (SME) program.', ''),
(2845, '7 steps for navigating your organization through change', 'https://stackoverflowsolutions.com/teams/7-steps-for-navigating-your-organization-through-change', 'When you’re planning a substantial change that will impact your entire team, it’s important to put a framework in place that will set up your organization for success in the transition. You’ll need to be able to educate and engage your team, and to set up a system of tracking success so that you know what’s working and what’s not as you complete the process.', ''),
