(2857, 'More than Q&A: How Stack Overflow’s sales, marketing, product, and engineering teams use Stack Overflow for Teams', 'https://stackoverflowsolutions.com/teams/five-ways-our-whole-company-uses-stack-overflow', 'The majority of companies are now working remotely and asynchronous collaboration is more important than ever. Companies around the globe use Stack Overflow for Teams to do just that (including those that newly adopted the platform since we made it free through June 2020). But only one company has been using Teams since its inception: us.', ''),
(2858, 'The hidden impact of siloed and disorganized information', 'https://stackoverflowsolutions.com/teams/the-hidden-impact-of-siloed-information', 'How much of your team’s time is spent not producing work, but searching for answers that already exist within your organization? Most likely, far too much.', ''),
(2859, 'Scaling your VPN overnight', 'https://stackoverflowsolutions.com/teams/scaling-your-vpn-overnight', 'Stack Overflow is 100% remote, as of March 9, 2020. And one of the critical tools that helps us work securely is our VPN. This article covers how we made our decision and best practices to follow.', ''),
(2860, 'How to choose the right productivity tech stack', 'https://stackoverflowsolutions.com/teams/choose-the-right-productivity-tech-stack', 'Your organization has put a lot of thought into building its tech stack for application development—but how carefully have you curated the toolset that enables your team to do its best work? ', ''),
