(2862, 'How to handle your lead engineer leaving', 'https://stackoverflowsolutions.com/teams/how-to-handle-lead-engineer-leaving', 'Your lead engineer just left the company. Perhaps they were lured by a better offer from a startup, or offered the chance to work with new technologies they’ve been passionate about learning. Whatever the case, they were the one to architect most of your company’s product backend—and by losing them, you’re losing access to a massive amount of domain knowledge.', ''),
(2863, 'My product manager just left - what do I do?', 'https://stackoverflowsolutions.com/teams/my-product-manager-left', 'So your product manager—the one who holds everything together and keeps your entire team running on task—just left the company. What do you do?', ''),
