(2942, 'XMLHttpRequest - Web APIs | MDN', 'https://developer.mozilla.org/en-US/docs/Web/API/XMLHttpRequest#send%28%29', 'XMLHttpRequest (XHR) objects are used to interact with servers. You can retrieve data from a URL without having to do a full page refresh. This enables a Web page to update just part of a page without disrupting what the user is doing.', ''),
